// HasIssuedCertificate applies the HasEdge predicate on the "issued_certificate" edge.
func HasIssuedCertificate() predicate.CertificateDetails {
	return predicate.CertificateDetails(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, IssuedCertificateTable, IssuedCertificateColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasIssuedCertificateWith applies the HasEdge predicate on the "issued_certificate" edge with a given conditions (other predicates).
func HasIssuedCertificateWith(preds ...predicate.IssuedCertificate) predicate.CertificateDetails {
	return predicate.CertificateDetails(func(s *sql.Selector) {
		step := newIssuedCertificateStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.CertificateDetails) predicate.CertificateDetails {
	return predicate.CertificateDetails(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CertificateDetails) predicate.CertificateDetails {
	return predicate.CertificateDetails(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CertificateDetails) predicate.CertificateDetails {
	return predicate.CertificateDetails(sql.NotPredicates(p))
}
